Le kip est la monnaie nationale de la République populaire et démocratique du Laos (RPDL). Son code international ISO 4217 est LAK. Le 24 juillet 2019, le kip est coté à 9 685 kips pour 1 euro. C'est une des huit devises dont le taux de change est supérieur à 5 000 unités monétaires pour 1 euro. Ce sont (dans l'ordre croissant de leur valeur en euro) : 
* le rial iranien à 35 310 rials pour 1 euro ; 
* le dong vietnamien à 25 237 dongs pour 1 euro (10/2015) ; 
* la roupie indonésienne à 15 684 roupies pour 1 euro ; 
* le rouble biélorusse à 13 926 roubles pour 1 euro ; 
* le kip laotien à 9 817 kips pour 1 euro ; 
* le franc guinéen à 9 396 francs pour 1 euro ; 
* le guarani paraguayen à 5 618 guaranis pour 1 euro ; 
* le riel cambodgien à 5 425 riels pour 1 euro.
